import React from 'react'
import styled, { keyframes } from "styled-components";
import { Form, Button } from "antd";

function ButtonQuestion(props) {
    const rotate1 = keyframes`
    from {
      opacity: 0.0;
    }
  
    to {
      opacity: 1.0;
    }
  `;
  const ShowButton1 = styled.div`
    textalign: center;
    width: 100%;
    display: flex;
    flexdirection: row;
    animation: ${rotate1} 2s linear;
  `;

    return (
        <ShowButton1>
          <div
            style={{
              width: "100%",
              flexBasis: "auto",
              justifyContent: "flex-end",
              display: "flex",
            }}
          >
            <Button
              className="nu-btn-question"
              onClick={() => {
                props.click(false, "...");
              }}
            >
              ไม่ใช่
            </Button>
          </div>
          <div
            style={{
              width: "100%",
              flexBasis: "auto",
              justifyContent: "flex-start",
              display: "flex",
            }}
          >
            <Button
              className="nu-btn-question"
              type="primary"
              onClick={() => {
                props.click(true, "...");
              }}
            >
              ใช่
            </Button>
          </div>
        </ShowButton1>
      );
}

export default ButtonQuestion
